import style from './ToDo.module.css';

const ToDo = () => {
    return (
        <div className={style['task-content']}>
            <p className={style['to-do']}>To do:</p>
            <div className={style['list-inp']}>
                <p>Create:</p>
                <input placeholder='task' />
                <p className={style['update']}>Update:</p>
                <input placeholder='Number' />
                <input placeholder='task' />
                <p className={style['delete']}>Delete:</p>
                <input placeholder='Number' />
            </div>
        </div>
    );
}

export default ToDo;
